def intersect_lists(*lists):
    # Преобразуем первый список в множество
    common_elements = set(lists[0])

    # Находим пересечение с остальными списками
    for lst in lists[1:]:
        common_elements.intersection_update(lst)

    # Преобразуем обратно в список
    return list(common_elements)


def find_common_elements(*lists):
    # Получаем все вторые части элементов из первого списка
    common_suffixes = set(item.split('_')[0] for item in lists[0])

    # Ищем общие вторые части для всех списков
    for lst in lists[1:]:
        current_suffixes = set(item.split('_')[0] for item in lst)
        common_suffixes.intersection_update(current_suffixes)

    # Собираем элементы с общими вторыми частями
    common_elements = []
    for suffix in common_suffixes:
        for lst in lists:
            common_elements.extend(item for item in lst if item.split('_')[0] == suffix)

    return list(set(common_elements))  # Убираем дубликаты


